import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";
import Facebook from './Facebook';
import Dachboard from './Dachboard';
import LoadingBar from 'react-redux-loading-bar'
function App() {
    return (
        <>
            <LoadingBar style={{ background: "#E5017D", zIndex: 99, position: "fixed", }} />
            <Router>
                <Switch>
                    <Route path="/dachboard">
                        <Dachboard />
                    </Route>
                    <Route path="/">
                        <Facebook />
                    </Route>
                </Switch>
            </Router>
        </>
    )
}

export default App
